description:
En el espacio que hay junto a las pistas de patinaje en la calle Antonio Machado no se barre periódicamente, ni se recogen con la frecuencia debida las papeleras, dando un aspecto sucio a la zona, muy concurrida por niños, especialmente los fines de semana, momento en el que se reúnen para practicar el patinaje. 
Esta desatención se ha planteado años pasados, según años y código de incidencia que se indica:

2018: 5922029; 
2020 : 63541580; 
2022: 6956234; 
2023: 7547172
